import React from 'react';
import '../styles/About.css'
import Header from '../components/Header';
import Headshot from '../images/headshot.jpeg';

function About () {
  return (
    <div className='about'>
      <Header />
      <div className='about-container'>
        <div className='about-title'>about me</div>
        <div className='about-profile'>
          <div className='profile-photo'>
            <img src={Headshot} alt="Headshot" />
          </div>
          <div className='profile-bio'>I am Connor Gilbert, a web developer who began studying in 2022. I have a passion for creating 
          interesting, reactive websites which I make using vanilla Javascript, HTML, CSS, React, and node.js.
          </div>
        </div>
      </div>
    </div>
  )
}

export default About
